  false,\n\t\"url\": null,\n\t\"notes\": \"The Water Resource Inventory and Assessment
  (WRIA) for Okefenokee National Wildlife Refugesummarizes available information relevant
  to refuge water resources, provides an assessment of water resource needs and issues
  of concern, and makes recommendations to address the identified needs and concerns.
  Major topics covered in this report include the natural setting of the refuge (topography,
  climate, geology, soils, hydrology), impacts of development and climate change,
  significant water resources and associated infrastructure within the refuge, past
  and current water monitoring activities on and near the refuge, water quality and
  quantity information, and state water use regulatory framework. Information was
  compiled from publicly available reports, databases, and geospatial datasets from
  federal, state, and local agencies; published research reports; websites maintained
  by government agencies, academic institutions, and non-governmental organizations;
  and from files and GIS data layers maintained by the refuge. For the purposes of
  this assessment, the Region of Hydrologic Influence (RHI) was defined as the Upper
  Suwannee and St. Marys River watersheds, and a portion of the Satilla watershed
  to the north. The RHI includes a total drainage area of 2,978,461 acres.\",\n\t\"license_title\":
